import React, { useEffect } from 'react'
import {useSelector,useDispatch} from "react-redux"
import { addMovies, fetchMovies } from '../features/movieSlice'

const Movielisting = () => {

  const movies = useSelector(addMovies)
  const dispatch = useDispatch();

  useEffect(()=>{
    dispatch(fetchMovies())
  },[dispatch])

 return (
    <div className='movie'>
      {movies.payload}
    </div>

  )
}

export default Movielisting
